import SobreNos from './Paginas/SobreNos';
import { BrowserRouter as Router, Switch, Route, Link, useHistory } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Login />
